@lizzy.dances has been bullied her entire life. when @jordanmatter asked if i'd help her pursue her dreams of moving to LA and becoming a professional dancer i knew how big of an impact her story could make

we laughed, we cried, we sweat.. and we watched jordan do whatever that was in the last frame 🤔 but because Lizzy had the courage to be herself, share her struggles and overcome her fears she's on her way to LA and the response has been overwhelming. 

lizzy you're an inspiration to all of us and this is only the beginning 💙

